import org.hamcrest.CoreMatchers;
import org.junit.Assert;
import org.junit.Test;

public class MinimumWindowSubstringTest {
	@Test
	public void test() {
		MinimumWindowSubstring m = new MinimumWindowSubstring();
		String result;

		result = m.minWindow("ADOBECODEBANC", "ABC");
		Assert.assertThat(result, CoreMatchers.equalTo("BANC"));

		result = m.minWindow("AADBBEFCDBA", "ABC");
		Assert.assertThat(result, CoreMatchers.equalTo("CDBA"));

		result = m.minWindow("ABAAC", "ABC");
		Assert.assertThat(result, CoreMatchers.equalTo("BAAC"));

		result = m.minWindow(
				"",
				"");

		Assert.assertThat(result, CoreMatchers.equalTo(
				""));


	}
}